import { randomDiamondStaff } from "@/api/index";
export default {
  name: "diamondRecruit",
  data: function data() {
    return {
      columns: [{
        type: "index",
        width: 60,
        align: "center"
      }, {
        title: "xmlId",
        key: "xmlId",
        width: 150,
        align: "center"
      }, {
        title: "数量",
        key: "num",
        width: 150,
        align: "center"
      }],
      userId: '',
      cnt: '',
      typeId: '5',
      staffs: []
    };
  },
  methods: {
    onSubmit: function onSubmit() {
      var _this = this;

      this.staffs = [];

      if (!this.userId || !this.cnt) {
        this.$Message.error('参数为空');
        return;
      }

      randomDiamondStaff({
        userId: this.userId,
        cnt: this.cnt,
        typeId: this.typeId
      }).then(function (res) {
        if (res.status == 200) {
          _this.staffs = res.data.staffs;
        } else {
          if (res.code !== 403) {
            _this.$Message.error('系统错误');
          }
        }
      });
    }
  }
};
